import './App.css';
import { useState } from 'react';
import { Link } from 'react-router-dom';

function Signup() {

    const [isFormSubmitted, setFormSubmitted, isInError, setIsInError] = useState(false);

    const submitForm = () => {
        setFormSubmitted(true)

    }


    return (

        <div >
            <h2>Signup</h2>

            <div className="signup-form-items">
                <label htmlFor="email">Enter email</label>
                <input id="email" placeholder="Email address..."></input>
            </div>

            <div className="signup-form-items">
                <label htmlFor="password">Enter password</label>
                <input id="password" placeholder="Password..."></input>
            </div>

            <Link to="./">
                <button className="btn btn-dark">Go Back</button>
            </Link>

            <Link to="./PickLeagues">
                <button className="btn btn-dark" onClick={submitForm()}>Next</button>
            </Link>

        </div>
    );
}

export default Signup;
